int __reg_index_1(int codedreg) {
	if ((codedreg & 0xFF000000) == 0) return 0;
	return ((codedreg & 0x00FF0000) << 8) | ((codedreg >> 8) & 0xFF);
}

int __reg_index_2(int codedreg) {
	if ((codedreg & 0xFF000000) == 0) return 0;
	if ((codedreg & 0xFF000000) == 0x02000000)
		codedreg = -(codedreg & 0xFF) - 1;
	else
		codedreg &= 0xFF;
	return codedreg;
}

