int __ISDONE_N(TASK* task, int r) {
	int i = 0;
	unsigned int th;
	while ((th = _I(task, r, i, 0))) {
		TASK* t = getTaskFromHandle(th);
		if (t != NULL) {
			if (t->state == TASK_UNUSED) continue;
			return 0;
		}
		i++;
	}
	return 1;
}

